import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      pokemonList: [],
      name: ""
    }
  }

  componentDidMount() {
    fetch("https://pokeapi.co/api/v2/pokedex/kanto/")
    .then(result => result.json())

    .then(pokedex => {
        let pokemons = pokedex.pokemon_entries;
        let list = [];

        pokemons.forEach(element => {
          fetch(element.pokemon_species.url)
            .then(result => result.json())
            .then(pokemon => {
              //console.log(pokemon);
              list.push(pokemon);
              console.log(list)
            });
        });

        console.log(list.length);
    });
  }

  render() {
    console.log(this.state.pokemonList)
    return (
      <h1>{this.state.name}</h1>
    )
    //console.log(this.props.pokemons);
    /*return (
      <div className="App">
        ESKERE
      </div>
    );*/
  }
}

export default App;
